import styled from "styled-components";
import { CoreBoxWidth } from "../../../core/core.styles";

export const MainWrap = styled.div`
   display: flex;
   width: 100%;
   padding: 2rem 0;
   justify-content: center;
`;

export const Content = styled(CoreBoxWidth)`
    padding: 0 20px;
`;
